css:
@font-face {
  font-family: 'Octicons Regular';
  src: url("octicons.woff") format("woff");
  font-weight: normal;
  font-style: normal;
}
html {
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 12px;
}
html,
body {
  width: 100%;
  height: 100%;
  overflow: hidden;
}
atom-workspace {
  display: flex;
  flex-direction: column;
  height: 100%;
  overflow: hidden;
  position: relative;
  color: #a7a8a9;
  background-color: #2b2b2c;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
}
atom-workspace atom-workspace-axis.horizontal {
  display: flex;
  flex: 1;
}
atom-workspace atom-workspace-axis.vertical {
  display: flex;
  flex: 1;
  flex-direction: column;
}
